import './Estilos/Cover.css';
import './Estilos/First_sentence.css';

function Home() {
    return (
        className = "Cover" >
        <h className='First_sentence'>
            "Music is like people <br />
            everyone has a different Tone"
        </h>
    );
}

export default Home;
